import React from "react";
import StickyBlockBox from "./index";

function BlockBox() {
  const list = [
    {
      name: "It技术",
      type: "H1",
      href: "#it",
      node: [
        {
          name: "React",
          type: "H2",
          href: "#react"
        },
        {
          name: "VUE",
          type: "H2",
          href: "#vue"
        }
      ]
    },
    {
      name: "JavaScript",
      type: "H1",
      href: "#javascript"
    },
    {
      name: "VUE",
      type: "H2",
      href: "#vue"
    }
  ];
  return (
    <div>
      <StickyBlockBox list={list} />
    </div>
  );
}
export default BlockBox;
